pragma solidity ^0.4.17;

import './Ownable.sol';

/// @title Interface for contracts conforming to ERC-721: Non-Fungible Tokens
/// @author Dieter Shirley <dete@axiomzen.co> (https://github.com/dete)
contract ERC721 {
    // Required methods
    function totalSupply() public view returns (uint256 total);
    function balanceOf(address _owner) public view returns (uint256 balance);
    function ownerOf(uint256 _tokenId) external view returns (address owner);
    function approve(address _to, uint256 _tokenId) external;
    function transfer(address _to, uint256 _tokenId) external;
    function transferFrom(address _from, address _to, uint256 _tokenId) external;

    // Events
    event Transfer(address from, address to, uint256 tokenId);
    event Approval(address owner, address approved, uint256 tokenId);

    // Optional
    // function name() public view returns (string name);
    // function symbol() public view returns (string symbol);
    // function tokensOfOwner(address _owner) external view returns (uint256[] tokenIds);
    // function tokenMetadata(uint256 _tokenId, string _preferredTransport) public view returns (string infoUrl);

    // ERC-165 Compatibility (https://github.com/ethereum/EIPs/issues/165)
    // function supportsInterface(bytes4 _interfaceID) external view returns (bool);
}



contract AnimeFace is Ownable {

  /// @notice Name and symbol of the non fungible token, as defined in ERC721.
  string public constant name = "GanToken";
  string public constant symbol = "GT";

  modifier owns(uint256 imageId) {
    require(face_mapping[imageId] == msg.sender);
    _;
  }

  struct Offer {
    bool isForSale;
    uint256 faceId;
    address seller;
    uint minValue;          // in ether
    address onlySellTo;     // specify to sell only to a specific person
  }

  struct Bid {
    bool hasBid;
    uint256 faceId;
    address bidder;
    uint value;
  }

  /// @dev list of all owned face ids
  uint256[] public faceIds;

  /// @dev a mpping for all the faces
  mapping(uint256 => address) public face_mapping;

  /// @dev mapping to keep owner balances
  mapping(address => uint256) public ownershipCounts;

  /// @dev mapping to owners to an array of faces that they own
  mapping(address => uint256[]) public ownerBank;

  /// @dev a list of withdraws 
  mapping(address => uint256) public pendingWithdrawals;

  mapping(uint256 => Offer) public faceOfferedForSale;

  mapping(uint256 => address) public ganIndexToApproved;
  ///
  mapping(uint256 => Bid) public faceBids;

  event Transfer(address indexed from, address indexed to, uint256 value);
  event BidForFaceOffered(uint256 faceId, uint256 value, address sender);
  // event FaceTransfer()
  // enent FaceBidWithdrawn()
  event NewFace(uint256 faceId, address claimer);
  event FaceBought(uint256 faceId, uint256 value, address sender, address bidder);
  event FaceOfferedForSale(uint256 faceId, uint256 minSalePriceInWei, address onlySellTo);
  event FaceNoLongerForSale(uint256 faceId);
  event Approval(address owner, address approved, uint256 tokenId);
  /// @dev Required for ERC-721 compliance.
  function totalSupply() public view returns (uint256 total) {
    return faceIds.length;
  }

  /// @dev Required for ERC-721 compliance.
  function balanceOf(address _owner) public view returns (uint256 balance) {
    balance = ownershipCounts[_owner];
  }

  /// @dev Required for ERC-721 compliance.
  function ownerOf(uint256 _tokenId) external view returns (address owner) {
    owner = face_mapping[_tokenId];
  }

  /// @dev returns all owners' FaceIds
  /// @dev Required for ERC-721 compliance.
  function tokensOfOwner(address _owner) external view returns (uint256[]) {
    uint256 tokenCount = ownershipCounts[_owner];

    if (tokenCount == 0) {
      return new uint256[](0);
    }

    uint256[] memory result = new uint256[](tokenCount);

    for (uint256 i = 0; i < tokenCount; i++) {
      result[i] = ownerBank[_owner][i];
    }

    return result;
  }

  /// @notice Grant another address the right to transfer a specific face via
  ///  transferFrom(). This is the preferred flow for transfering NFTs to contracts.
  /// @param _to The address to be granted transfer approval. Pass address(0) to
  ///  clear all approvals.
  /// @param _tokenId The ID of the Kitty that can be transferred if this call succeeds.
  /// @dev Required for ERC-721 compliance.
  function approve(address _to, uint256 _tokenId) external owns(_tokenId) {
      // Register the approval (replacing any previous approval).
      ganIndexToApproved[_tokenId] = _to;

      // Emit approval event.
      // Approval(msg.sender, _to, _tokenId);
  }

  // 
  function transferFrom(address _from, address _to, uint256 _tokenId) external payable {
    require(_to != 0x0);
    require(_to != address(this));
    require(ganIndexToApproved[_tokenId] == msg.sender);
    require(face_mapping[_tokenId] == _from);

    face_mapping[_tokenId] = _to;

    uint256 tokenCount = ownershipCounts[_from];
    // remove from ownerBank and replace the deleted face id
    for (uint256 i = 0; i < tokenCount; i++) {
      uint256 id = ownerBank[_from][i];
      if (id == _tokenId) {
        delete ownerBank[_from][i];
        if (i != tokenCount) {
          ownerBank[_from][i] = ownerBank[_from][tokenCount - 1];
        }
        break;
      }
    }

    ownershipCounts[_from]--;
    ownershipCounts[_to]++;
    ownerBank[_to].push(_tokenId);

    Transfer(_from, _to, _tokenId);

  }

  function newGanToken(uint256 _noise) external payable {
    require(msg.sender != address(0));
    require(face_mapping[_noise] == 0x0);

    faceIds.push(_noise);
    ownerBank[msg.sender].push(_noise);
    face_mapping[_noise] = msg.sender;
    ownershipCounts[msg.sender]++;

    NewFace(_noise, msg.sender);
  }

  // @dev returns the counts for the owner
  function getOwnerCounts(address _owner) external view returns (uint256) {
    return ownershipCounts[_owner];
  }

  /// @dev creates a list of all the faceids
  function getAllFaceIds() external view returns (uint256[]) {
    uint256[] memory result = new uint256[](faceIds.length);
    for (uint i = 0; i < result.length; i++) {
      result[i] = faceIds[i];
    }

    return result;
  }

  function faceNoLongerForSale(uint256 faceId) public payable owns(faceId) {
    faceOfferedForSale[faceId] = Offer(false, faceId, msg.sender, 0, 0x0);

    FaceNoLongerForSale(faceId);
  }

  function offerFaceForSale(uint faceId, uint256 minSalePriceInWei) external payable owns(faceId) {
    faceOfferedForSale[faceId] = Offer(true, faceId, msg.sender, minSalePriceInWei, 0x0);

    FaceOfferedForSale(faceId, minSalePriceInWei, 0x0);
  }

  function offerFaceForSaleToAddress(uint faceId, address sendTo, uint256 minSalePriceInWei) external payable {
    require(face_mapping[faceId] == msg.sender);
    faceOfferedForSale[faceId] = Offer(true, faceId, msg.sender, minSalePriceInWei, sendTo);

    FaceOfferedForSale(faceId, minSalePriceInWei, sendTo);
  }

  function buyGanToken(uint256 id) external view {
    // faceNoLongerForSale(id);
    Offer memory offer = faceOfferedForSale[id];
    require(offer.isForSale);
    // require(offer.onlySellTo == msg.sender && offer.onlySellTo != 0x0);
    // require(msg.value > offer.minValue);
    // require(face_mapping[id] == offer.seller);


    // uint256 tokenCount = ownershipCounts[offer.seller];
    // // remove from ownerBank and replace the deleted face id
    // for (uint256 i = 0; i < tokenCount; i++) {
    //   uint256 ownedId = ownerBank[offer.seller][i];
    //   if (id == ownedId) {
    //     delete ownerBank[offer.seller][i];
    //     if (i != tokenCount) {
    //       ownerBank[offer.seller][i] = ownerBank[offer.seller][tokenCount - 1];
    //     }
    //     break;
    //   }
    // }

    // ownershipCounts[offer.seller]--;
    // ownershipCounts[msg.sender]++;
    // ownerBank[msg.sender].push(id);

    // face_mapping[id] = msg.sender;

    // Transfer(offer.seller, msg.sender, 1);
  }

  function enterBidForFace(uint256 faceId) external payable {
    Bid memory existing = faceBids[faceId];
    require(face_mapping[faceId] != msg.sender);
    require(msg.value > existing.value);
    if (existing.value > 0) {
      // Refund the failing bid
      pendingWithdrawals[existing.bidder] += existing.value;
    }

    faceBids[faceId] = Bid(true, faceId, msg.sender, msg.value);
    BidForFaceOffered(faceId, msg.value, msg.sender);
  }

  function acceptBid(uint256 noise, uint256 minPrice) external payable {
    require(face_mapping[noise] == msg.sender);
    Bid memory bid = faceBids[noise];
    require(bid.value != 0);
    require(bid.value > minPrice);

    face_mapping[noise] = bid.bidder;

    uint256 tokenCount = ownershipCounts[msg.sender];
    // remove from ownerBank and replace the deleted face id
    for (uint256 i = 0; i < tokenCount; i++) {
      uint256 id = ownerBank[msg.sender][i];
      if (id == noise) {
        delete ownerBank[msg.sender][i];
        if (i != tokenCount) {
          ownerBank[msg.sender][i] = ownerBank[msg.sender][tokenCount - 1];
        }
        break;
      }
    }

    ownershipCounts[msg.sender]--;
    ownershipCounts[bid.bidder]++;
    ownerBank[bid.bidder].push(noise);

    face_mapping[noise] = bid.bidder;

    faceOfferedForSale[noise] = Offer(false, noise, bid.bidder, 0, 0x0);
    Transfer(msg.sender, bid.bidder, 1);
    pendingWithdrawals[msg.sender] += bid.value;
    FaceBought(noise, bid.value, msg.sender, bid.bidder);
  }

  function isOnSale(uint256 _noise) external view returns (bool) {
    return faceOfferedForSale[_noise].isForSale;
  }

  function getSaleData(uint256 _noise) public view returns (bool isForSale, address seller, uint minValue, address onlySellTo) {
    Offer memory offer = faceOfferedForSale[_noise];
    isForSale = offer.isForSale;
    seller = offer.seller;
    minValue = offer.minValue;
    onlySellTo = offer.onlySellTo;
  }

  function getBidData(uint256 _noise) view public returns (bool hasBid, address bidder, uint value) {
    Bid memory bid = faceBids[_noise];
    hasBid = bid.hasBid;
    bidder = bid.bidder;
    value = bid.value;
  }

  // function withdrawBidForPunk(uint punkIndex) {
  //     if (punkIndex >= 10000) throw;
  //     if (!allPunksAssigned) throw;                
  //     if (punkIndexToAddress[punkIndex] == 0x0) throw;
  //     if (punkIndexToAddress[punkIndex] == msg.sender) throw;
  //     Bid bid = punkBids[punkIndex];
  //     if (bid.bidder != msg.sender) throw;
  //     PunkBidWithdrawn(punkIndex, bid.value, msg.sender);
  //     uint amount = bid.value;
  //     punkBids[punkIndex] = Bid(false, punkIndex, 0x0, 0);
  //     // Refund the bid money
  //     msg.sender.transfer(amount);
  // }

  function withdraw() external {
    uint256 amount = pendingWithdrawals[msg.sender];
    // Remember to zero the pending refund before
    // sending to prevent re-entrancy attacks
    pendingWithdrawals[msg.sender] = 0;
    msg.sender.transfer(amount);
  }

}
